    "id": "143667331",
    "title": "Wyndham Accciones en Venta en Mazatlan",
    "description": "Nus suites & plaza, somos un modelo de inversion hotelero con enfoque patrimonial, se ponen A disposicion 400 acciones, adquiriendo un derecho de propiedad que los convierte en copropietarios del inmueble constituido por cinco niveles de hotel, distribuidas 146 suites (140 suites dobles Y 2 triples). El proyecto hotelero cuenta con amenidades como: 1. 2 albercas, 1 chapoteadero, gymnasio, bar Y restaurante (mismo que tambien genera utilidades A los inversionistas) hotel operado por la cadena hotelera wyndham garden mazatlan franquicia americana de nivel internacional, con gran impacto global, con mas de 9, 000 hoteles operando en distintos paises, con 23 marcas hoteleras, en mas de 80 paises Y un crecimiento hotelero del 20% en el pais, con 68 hoteles operados en mexico, Y una garantia de estancia hotelera conformada por 93, 000 millones de miembros inscritos A la marca. Con un esquema de administracion externa (aimbridge hospitality) quien llevara la administracion del hotel, con una experiencia sustentable en el area administrativa hotelera, Y la experencia de mas de 42 hoteles administrados en mexico. Beneficios directos en pool de rentas por accion: 6 noches 7 dias como derecho de uso de su hotel, descuentos para noches adicionales (10% temporada alta 15% temporada baja noches) un % de rendimiento por las 146 suites rentables, % en rendimiento de bar Y restaurante, una co-propiedad del inmueble (5 pisos de hotel) la misma que les garantiza una plusvalia considerable año con año la que hara crecer tu inversion Y tener un retorno de inversion incial A corto plaza. Cada accion O participacion equivale A un 0. 25% del derecho de propiedad con su porcentaje de operación hotelera (1/400). Hotel que inicia su apertura el 01 de julio del 2024. La plusvalia Y la rentabilidad van de la mano en este modelo de negocio, se estima un 10 % de aumento en plusvalia al inicio del proyecto en su primer año 2024 Y un 20% acumulable del 2023. Area marina S. A. P. I. De C. V. Blvd. La marina 2207 cp <span class='descripcionDatosAnunciante'><button class='btn btn-link js-verDatos' href='#'>Ver datos</button></span>, mazatlan sinaloa 2 el retorno de inversion (roi) es la utilidad O ganancia que puede llegar A obtener el accionista de las operaciones hoteleras que se deriven de este modelo de negocio. Este rendimiento es variable (depende de la ocupacion hotelera anual en mazatlan, se considera un 70% de ocupacion turistica actualmente) se estima una rentabilidad minima del 7% al 8% anual hasta alcanzar un 14%, 15% en la apertura del proyecto. El pago de rendimientos sera trimestral con corte mensual, Y los pagos de rendimientos de estipulan A finales de mes para evitar carga administrativa. El rendimiento O utilidad sera dividida en 400 acciones, correspondientes del monto total de los estados financieros al periodo trimestral de que se trate. Se otorgara un certificado de participacion inmobiliaria (cpi) son titulos emitidos por instituciones fiduciarias (banregio) se emiten con la finalidad de que un grupo de inversionistas fueran beneficiados con la rentabilidad de una inversion. Este certificado es enajenable (heredable, vendible, donable, transpasable) A terceras personas (inversionista sustituto) teniendo la libertad absoluta de ejercer este derecho en cualquier momento, notificando previamente por escrito A la administracion del desarrollador. La inscripcion del mismo se dara 30 dias habiles posteriores A la apertura del proyecto. En el area juridica se blinda mediante un fideicomiso inmobiliario de garantia acto juridico de confianza de actividad empresarial, es un sistema juridico limitado que brinda la seguridad A este negocio, ya que custodia el inmueble Y el negocio, Y queda protegido de cualquier situacion legal (inembargable) con una duracion de 50 años Y renovables cada 50 años (pago unico por parte del accionista), tiene un costo de inscripcion de $30, 000. 00 pesos. Los accionistas que adquieran dos O mas acciones solo pagaran un gasto administrativo. Los beneficiarios son las personas designadas por el accionista (mayores de edad), en caso de fallecimiento del mismo estos seran considerados como titulares de los derechos Y obligaciones Y tendran el derecho de cobro de los rendimientos trimestrales. Fecha estimada de apertura: julio 2024. Precio actual de la participcion $1, 500, 000. 00 mn apartado de $50, 000. 00 (liquidar en junio) promocion del mes: el pago del fideicomiso queda exento",
